/* IPFS */
const ipfsClient = require('ipfs-http-client');
const CID = require('cids');
const ipfs = new ipfsClient({ host: 'ipfs.infura.io', port: '5001', protocol: 'https' });

/* Web3 / Ganache */
const Web3 = require("web3")
const provider = new Web3(new Web3.providers.HttpProvider("http://localhost:8545"));
const web3 = new Web3(provider);

/* Contract */
const fs = require('fs');
const dotenv = require('dotenv');
dotenv.config();
if (!process.env.CONTRACT_ADDRESS) { console.log('Add CONTRACT_ADDRESS=(contract address) to .env'); process.exit() }
const contractBuild = JSON.parse(fs.readFileSync('./build/contracts/ipfsNFT.json', 'utf8'));
const ABI = contractBuild.abi;
const contract = new web3.eth.Contract(ABI, process.env.CONTRACT_ADDRESS);

/* Data to pin */
let cr0wnImg = "data:image/png;base64,";
let troyImg = 'data:image/png;base64,';
let attr_1 = {"trait_type": "Crown", "value": "True"};
let attr_2 = {"trait_type": "Ghoul", "value": "False"};
let attr_3 = {"trait_type": "Dumbzo", "value": "True"};
let pinData = [cr0wnImg, troyImg, JSON.stringify(attr_1), JSON.stringify(attr_2), JSON.stringify(attr_3)];

/* Pin data to IPFS */
async function uploadData() {
    let itemCIDS = []
    for await (const i of pinData) {
      try {
        let hash = await ipfs.dag.put(i)
        itemCIDS.push(hash.toString())
        console.log("Added " + hash.toString());
      } catch(ex) {
        console.log(ex)
      }
    }
    return JSON.stringify(itemCIDS);
}

/* Create random metadata from pinned data and DAG*/
async function createToken(items) {
  items = JSON.parse(items);
  /* image 1 or 2 */
  let image = items[(Math.floor(Math.random() * (2 - 0) + 0))];
  /* number of attributes */
  let numberOfAttrs = Math.floor(Math.random() * (4 - 1) + 1);
  /* Add Attributes */
  let attributes = []
  for (let i = 0; i <= numberOfAttrs; i++) {
    attributes.push(items[(Math.floor(Math.random() * (5 - 2) + 2))])
  }
  /* Create Metadata */
  let metadata = {
    "name": "Cr0wn_Gh0ul",
    "image": image,
    "attributes": attributes
  }
  let metadataCID = await ipfs.dag.put(metadata);
  return metadataCID.toString()
}

/* fetch data from structure */
async function getMetadata(CID) {
    let baseData = await ipfs.dag.get(CID, "/");
    console.log(baseData)

    let image = await ipfs.dag.get(baseData.value.image, "/");
    console.log("image: " + image.value.substring(0,32) + "...")

   for (let i = 0; i < baseData.value.attributes.length; i++) {
      let attr = await ipfs.dag.get(baseData.value.attributes[i]);
      console.log("attribute " + i + ": " + attr.value)
    }
}

/* Run */
async function runExample() {
  let acctAddrs = await web3.eth.personal.getAccounts();
  try {
    let itemCIDS = await uploadData()
    for (let i = 0; i < 6; i++) {
      let metadataCID = await createToken(itemCIDS);
      await contract.methods.newNFT(acctAddrs[0], metadataCID).send({from: acctAddrs[0], gas: 5000000});
      console.log("Minted " + metadataCID + " to " + acctAddrs[0]);
      console.log("Getting data from metadata CID")
      await getMetadata(metadataCID);
    }
  } catch(ex) {
    console.log(ex)
  }
}
runExample();
